    protected override async Task OnInitializedAsync()
    {
        var currentUserEmail = await JSRuntime.InvokeAsync<string>("localStorage.getItem", "userEmail");

        if (String.IsNullOrEmpty((string)currentUserEmail) == false)
        {
            ShowLogin = false;
        }
        else
